import React, { useState } from "react";
import List from "./List";

const FeedbackItem = ({ feedback }) => {
  if (!feedback || feedback.length === 0) {
    return <p>No Feedback</p>;
  }

  return (
    <>
      <div className="card">
        {feedback.map((item,id) => (
          <List key={id} item={item} />
        ))}
      </div>
    </>
  );
};

export default FeedbackItem;
